import React from 'react';
import { Carousel } from 'react-bootstrap';
import '../css/MyCarousel.css'
import main1 from'../../src/main_site1.png'
import main2 from'../../src/main_site2.png'
import mix from  '../img/mix.png'

const MyCarousel = () => {
  return (
    <Carousel className="custom-carousel" interval={1000}>
      <Carousel.Item>
        <img
          className="d-block w-100 custom-image"
          src={main1}
          alt="First slide"
          style={{ height: '79vh', objectFit: 'cover' }}
        />
        
      </Carousel.Item>

      <Carousel.Item>
        <img
          className="d-block w-100 custom-image"
          src={main2}
          alt="Second slide"
          style={{ height: '79vh', objectFit: 'cover' }}
        />
       
      </Carousel.Item>

      
    </Carousel>
  );
};

export default MyCarousel;
